text:
``` Veer Shiva Samsheer Maratha, Anupam Nutan santane;
Rakth Ubalta, soch dehalti, Vijay Pataka Lehrane;
Har ek Dushman laute bas Akhnoke mein Daar aur haar liyeeeee;
Jab Chale Maratha Jange ladne Hatho mein talwar liye; 
Jab Chale Maratha Jange ladne Hatho mein talwar liye. ```

This will summon all the memories whenever we will read it in the coming years.
